import PropTypes from 'prop-types';

const Login = () => (
  <nav className="login">
    <h2>Inventory</h2>
    <p>Sign in to manage your storeÂ´s inventory</p>
    <button
      className="github"
      onClick={()=> this.props.authenticate("Github")}
    >Log in with Twitter
    </button>
    <button
      className="twitter"
      onClick={()=> this.props.authenticate("Twitter")}
    >Log in with Twitter
    </button>
  </nav>
)

Login.propTypes = {
  authenticate: PropTypes.func.isRequired
}

export default Login;
